export const questions = [
    {
        question:"Why was heroku used?",
        answer:"Heroku allows for very rapid and continuous application deployment, a codebase on github is used and deployed to a heroku URL."
    },
    {
        question:"Why use react?",
        answer:"React is responsive and allows for HTML components to be reused making it very easy for developers to quickly implement a user interface."
    },
    {
        question:"Advantages and disadvantages of using a RESTful API?",
        answer:"Restful API is nice for web development, it allows endpoints to be used on a backend which allows for functionality to be seperated (reduces coupling), bad for live data transmission"
    },
    {
        question:"What are some of the difficulties encountered?",
        answer:"Making data display relatively live. Data could not be transmitted directly to user, it has to go through the backend, to the database, then get pulled by the frontend"
    },
    {
        question:"Why was spring boot used?",
        answer:"Spring boot allows for very rapid rest api implementation, and integrates very nicely with react and MySQL."
    },
    {
        question:"How do the operators know the patient ID and healthcare number?",
        answer:"Ensuring that health records are correct was outside the scope of the project, but in the future, the device can prompt the user for an input."
    },
]
